import React from 'react';

import User from './User';
import './UserList.css';

const UserList = props => {
  return (
    <ul className="user-list">
      {props.items.map(user => (
        <User
          key={user.id}
          id={user.id}
        >
          {user.name}
          {user.age}
        </User>
      ))}
    </ul>
  );
};

export default UserList;
